import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="App">
        <header className="toolbar">
          <ul>
            <li className="title">Cooper Hewitt</li>
            <li className="about">About</li>
          </ul>
        </header>
      </div>
    );
  }
}

export default App;
